import React from 'react';
import { Swiper, SwiperSlide } from 'swiper/react';
import 'swiper/swiper-bundle.css';

const ThreadSection = () => {
  return (
    <div className="swiper mySwiper pay_back_image">
      <div className="swiper-wrapper backgroundimg">
        <Swiper slidesPerView={1} spaceBetween={10} loop={true}>
          <SwiperSlide>
            <img src="img/pay6.webp" alt="Pay 6" />
          </SwiperSlide>
          <SwiperSlide>
            <img src="img/pay5.webp" alt="Pay 5" />
          </SwiperSlide>
          <SwiperSlide>
            <img src="img/pay4.webp" alt="Pay 4" />
          </SwiperSlide>
        </Swiper>
      </div>
    </div>
  );
};

export default ThreadSection;
